import React from "react";

const ChartCard = ({ title, children, button }) => (
  <div className="bg-white shadow-md rounded-md p-6">
    <h2 className="text-lg font-semibold mb-4">{title}</h2>
    <p>{button}</p>
    {children}
  </div>
);

export default ChartCard;
